import React from 'react';
import ReactDOM from 'react-dom';

const Work = () => {
    const title = {
        fontFamily:"Hind Siliguri",
        fontSize:"90px"
    }
    return(
        <React.Fragment>
            <div style={title}>
                Work
            </div>
        </React.Fragment>
    )
}

export default Work;
